    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {},
    "_viewModelId": "AwSearchResultFilter",
    "_uniqueViewModelId": "AwSearchResultFilter",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awSearchResultFilterRenderFunction, undefined, ctxImportObj );

export default Component;
